import nltk

def load_doc(file):
    f = open(file,'r')
    text = f.read()
    f.close()
    return text

def get_only_words(text):
    alphas  = list()
    for line in text.split('\n'):
        tokens = line.split()
        if len(line) < 2:
            continue
        sentence =  tokens[1:]
        alphas.append(" ".join(sentence))
    return alphas

def get_categories(vocab):
        nouns=list()
        is_noun = lambda pos: pos[:2] == 'NN'
        for lines in vocab:
            tokenized = nltk.word_tokenize(lines)
            tokenized = [word.lower() for word in tokenized]
            [nouns.append(word) for (word, pos) in nltk.pos_tag(tokenized) if is_noun(pos)]
        return nouns
        
